VALUES ('5400141377224', 'Cube bouillon de légumes', 'Ingrediënten - Ingrédients Groentebouillon - Zout, smaakversterker (E621), maltodextrine, extracten (gist, soja-eiwitten), palmvet, suiker, 3,7 % groenten (prei, uien, spinazie, selderij, wortelen, kool), zetmeel, aroma\'s (bevat selderij), kruiden en specerijen (knoflook, peterselie, kurkuma, witte peper), uien - en wortelenextract, antioxidant (E392). Vetarm. Bevat soja en selderij. Kan sporen van gluten, schaaldieren, eieren, vis en melk bevatten. Bouillon de légumes-Sel, exhausteur de goût (E621), maltodextrine, extraits (levure, protéines de soja), graisse de palme, sucre, 3,7% légumes (poireaux, oignons, épinards, céleri, carottes, chou), amidon, arômes (contient du céleri), plantes aromatiques et épices (ail, persil, curcuma, poivre blanc), extrait d\'oignons et de carottes, antioxydant (E392). Pauvre en graisse. Contient du soja et du céleri. Peut contenir des traces de glufen, de crustacés, d\'ceufs, de poisson et de lait.', 'https://static.openfoodfacts.org/images/products/540/014/137/7224/front_fr.6.400.jpg', '0.5', '0.1', '0.5', '0.5', '', '0.5', '1', '0.393700787401575', '', '1');

