VALUES ('5400141383461', 'Gosettes aux abricots', 'Bladerdeeg met abrikozenvulling - Tarwebloem, suiker, plantaardige olien en vetten (palmvet,palmolie en raapzaadolie, in wisselende verhoudingen), 11 % abrikozen, glucose-fructosestroop, gemodificeerd zetmeel, tarwezetmeel, zout, conserveermid - delen (E202, E282), voedingszuren (E270, E330), aroma (abrikoos), antioxidant (E300), emulgator (E471). Bevat gluten. Kan sporen van noten bevatten. Patisserie feuilletée fourrée aux abricots-Farine de blé, sucre, huiles et graisses végétales (graisse de palme, huile de palme et huile de navette, en proportion variable), 11% abricots, sirop de glucose-fructose, amidon modifié, amidon de blé, sel, conservateurs (E202, E282), acidifiants (E270, E330), arôme (abricot), antioxydant (E300), émulsifiant (E471). Contient du gluten. Peut contenir des traces de fruits a coque. Puff pastry with apricot filling-Wheat flour, sugar, vegetable oils and fats (palm fat, palm oil and rapeseed oil, in variable proportions), 11 % apricots, glucose-fructose Syrup, modified starch, wheat starch, salt, preservatives (E202, E282), acids (E270, E330), flavour (apricot), antioxidant (E300), emulsifier (E471). Contains gluten. May Contain traces of nuts.', 'https://static.openfoodfacts.org/images/products/540/014/138/3461/front_fr.15.400.jpg', '19', '9.5', '60', '33', '', '3.5', '1', '0.393700787401575', '', '0');

