VALUES ('5400141423730', 'Fish sticks', 'I Ingrediënten - Ingrédients Voorgebakken gepaneerde fish sticks, diepvries - 65 % Alaska pollak [Theragra chalcogramma, met trawlnetten gevangen in de Stille Oceaan (FAO 61 en 67)], 35 % paneermeel [tarwebloem, zonnebloemolie, zetmeel, water, zout, gist, specerijen (kurkuma, paprika, peper)]. Ondanks zorgvuldig fileren kan onbedoeld een graatje in de vis achtergebleven zijn. Bevat gluten en vis. Fish-sticks panés précuits, surgelés - 65 % colin d\'Alaska [Theragra chalcogramma, pêché au chalut dans l\'océan Pacifique (FAO 61 et 67)], 35 % chapelure [farine de blé, huile de tournesol, amidon, eau, sel, levure, épices (curcuma, paprika, poivre)]. Malgré un nettoyage soigneux du poisson, ce produit peut contenir dléventuelles arêtes résiduelles. Contient du gluten et du poisson.', 'https://static.openfoodfacts.org/images/products/540/014/142/3730/front_fr.4.400.jpg', '7.8', '0.9', '17', '0.5', '0.9', '12', '1', '0.393700787401575', '', '1');

